import React from "react";
import styled from "styled-components";
const StyledCartList = styled.div`
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 30px;
`;
const CardList = () => {
  return <StyledCartList></StyledCartList>;
};

export default CardList;
